import jsPDF from "jspdf";
import html2canvas from "html2canvas";
import domtoimage from "dom-to-image";

const margin = 0;
const imgData =
  "data:image/png;base64,";

export const pdfHandler = {
  createRFReport: (element, fileName, orientation, title) => {
    // documento
    let doc = new jsPDF({
      orientation: orientation,
      unit: "mm",
      format: "a4",
      floatPrecision: 30,
      compress: true,
    });

    doc.setFontSize(15);
    let scale =
      (doc.internal.pageSize.width - margin * 2) / element.scrollWidth;

    doc.addImage(imgData, "JPEG", 0, 0, 50, 30);
    doc.text(
      53,
      12,
      "Distribuidora de Electricidad DELSUR, S.A DE C.V. y Subsidiaria"
    );
    doc.setFontSize(10);
    doc.text(56, 18, "(Subsidiaria de EPM Latam, S.A)");
    doc.html(element, {
      x: 1,
      y: 50,
      image: {
        type: "jpeg",
        quality: 1,
      },
      html2canvas: {
        scale,
        letterRendering: true,
        backgroundColor: "#843B62",
      },
      callback: (doc) => {
        doc.setProperties({
          title: "Title",
          subject: "Reporte financiero empresa DelSur",
          author: "Software Financiero UES",
          keywords: "generated, javascript, web 2.0, ajax",
          creator: "UES",
        });
        doc.save(fileName);
      },
    });
  },
  createDPReport: (element, fileName, orientation) => {
    domtoimage
      .toPng(element)
      .then(function (dataUrl) {
        var img = new Image();
        img.src = dataUrl;
        const doc = new jsPDF({
          orientation: orientation,
          // unit: "pt",
          // alto, ancho
          format: [390, 390],
        });
        doc.setFontSize(15);
        doc.addImage(imgData, "JPEG", 0, 0, 60, 30);
        doc.text(
          70,
          12,
          "Distribuidora de Electricidad DELSUR, S.A DE C.V. y Subsidiaria"
        );
        doc.setFontSize(10);
        doc.text(75, 18, "(Subsidiaria de EPM Latam, S.A)");
        doc.addImage(img, "JPEG", 0, 30);
        doc.setProperties({
          title: "Title",
          subject: "Reporte financiero empresa DelSur",
          author: "Software Financiero UES",
          keywords: "generated, javascript, web 2.0, ajax",
          creator: "UES",
        });
        doc.save(fileName);
      })
      .catch(function (error) {});
  },
};
